import { default as Banner } from "../assets/Office-Door-1Small copy.jpg";

const containerStyle = {
	display: "flex",
	flexDirection: "column",
    marginTop: "-1em",
    width:"calc(100vw - 14em"
};

const bannerStyle = {
	float: "right"
};
export default function AboutUsPanel(props) {
	return (
		<div id="aboutusMarker" style={containerStyle}>
			<img src={Banner} alt="Office Banner Image" />
			<div className="textContainer">
				<h1>Shed Studio is...</h1>
				<p>{props.description}</p>
			</div>
		</div>
	);
}
